import React from 'react';

const RemoveAssetButton = () => {
  return (
    <button
      className="flex w-[130px] h-[41px] p-4 justify-center items-center gap-4 flex-shrink-0 rounded-lg bg-[#FF4B4B] text-[#343B3F] font-roboto text-[20px] font-semibold leading-normal cursor-pointer text-center"
    >
      Remove Asset
    </button>
  );
};

export default RemoveAssetButton;
